public class BreakDemo {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1; i<=30; i++) {
		     if((i==25) ){
		    	 break;
		    	 
		     }
			System.out.println(i);
	}
		
	}
}


